export default function Project(props) {
  return (
    <div className="card-wrapper">
      <div className="project-header">
        <p className="project-title">FinaceApp</p>
        <img src="icons/github.png"  className="github-icon"/>
      </div>
      {propss.children}
    </div>
  )
}
